import style from './Card.module.css'

export default function Card({name,image,species,gender,onClose}) {
   return (
      <div className={style.Carta}>
         
         <button className={style.btnx}  onClick={() => onClose(props.id)}>X</button>
         <h2>{name}</h2>
         <img className={style.img}  src={image} alt="" />
         <div className={style.texto}>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         </div>
      </div>
   );
}
